// EmailStatsWidget.js
import React, { useState, useEffect } from "react";
import { Mail, Calendar, Clock, AlertCircle } from "lucide-react";

const EmailStatsWidget = ({ onStatsUpdate }) => {
  const [stats, setStats] = useState({});
  const [reminders, setReminders] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    loadStats();
  }, []);

  const loadStats = async () => {
    try {
      setLoading(true);
      const [statsResponse, remindersResponse] = await Promise.all([
        fetch("http://localhost:8080/api/emails/stats"),
        fetch("http://localhost:8080/api/reminders/upcoming"),
      ]);

      const statsData = await statsResponse.json();
      const remindersData = await remindersResponse.json();

      setStats(statsData || {});
      setReminders(Array.isArray(remindersData) ? remindersData : []);

      if (onStatsUpdate) {
        onStatsUpdate({ stats: statsData, reminders: remindersData });
      }
    } catch (error) {
      console.error("Error loading email stats:", error);
      setStats({});
      setReminders([]);
    } finally {
      setLoading(false);
    }
  };

  const formatDate = (dateString) => {
    if (!dateString) return "No date";
    try {
      return new Date(dateString).toLocaleDateString("en-US", {
        month: "short",
        day: "numeric",
        hour: "2-digit",
        minute: "2-digit",
      });
    } catch (error) {
      return "Invalid date";
    }
  };

  if (loading) {
    return (
      <div className="email-stats-loading">
        <div className="spinner"></div>
      </div>
    );
  }

  const totalEmails = Object.values(stats.emailsByCategory || {}).reduce(
    (a, b) => a + b,
    0
  );
  const totalReminders = Object.values(stats.pendingReminders || {}).reduce(
    (a, b) => a + b,
    0
  );

  return (
    <div className="emailStatsWidget">
      <h3 className="email-stats-title"> Gmail Overview</h3>

      {/* Stats Cards */}
      <div className="email-stats-grid">
        <div className="email-stat-card">
          <Mail className="email-stat-icon blue" />
          <div className="email-stat-content">
            <span className="email-stat-number">{totalEmails}</span>
            <span className="email-stat-label">Total Emails</span>
          </div>
        </div>

        <div className="email-stat-card">
          <Calendar className="email-stat-icon green" />
          <div className="email-stat-content">
            <span className="email-stat-number">
              {stats.emailsByCategory?.INTERVIEW || 0}
            </span>
            <span className="email-stat-label">Interviews</span>
          </div>
        </div>

        <div className="email-stat-card">
          <Clock className="email-stat-icon yellow" />
          <div className="email-stat-content">
            <span className="email-stat-number">{totalReminders}</span>
            <span className="email-stat-label">Pending Reminders</span>
          </div>
        </div>

        <div className="email-stat-card">
          <AlertCircle className="email-stat-icon red" />
          <div className="email-stat-content">
            <span className="email-stat-number">
              {stats.emailsByCategory?.ASSESSMENT || 0}
            </span>
            <span className="email-stat-label">Assessments</span>
          </div>
        </div>
      </div>

      {/* Upcoming Reminders */}
      {reminders.length > 0 && (
        <div className="email-reminders-section">
          <h4 className="email-reminders-title">ðŸ”” Upcoming Reminders</h4>
          <div className="email-reminders-list">
            {reminders.slice(0, 3).map((reminder) => (
              <div key={reminder.id} className="email-reminder-item">
                <div className="email-reminder-content">
                  <span className="email-reminder-title">
                    {reminder.title || "No Title"}
                  </span>
                  <span className="email-reminder-date">
                    {formatDate(reminder.eventDateTime)}
                  </span>
                </div>
                <span className="email-reminder-type">
                  {reminder.type ? reminder.type.replace(/_/g, " ") : "Unknown"}
                </span>
              </div>
            ))}
          </div>
        </div>
      )}

      <button
        onClick={loadStats}
        className="email-refresh-btn"
        disabled={loading}
      >
        {loading ? "Refreshing..." : "ðŸ”„ Refresh"}
      </button>
    </div>
  );
};

export default EmailStatsWidget;
